import React from "react";


class Commands extends React.Component {
    state = {
        text: ""
    }
    ls = () => {
        console.log("hello")
        this.setState({
            text: "hello"
        })
    }
    listen = () => {
        this.ls()
        console.log("hel******lo")
    }
    render() {
        return (
            <li>{this.listen()}</li>
        )
    }
}

export default Commands
